import React from 'react'

const Sign_img = () => {
    return (
        <>
            <div className='right-data mt-5'>
                <div className='sign_img mt-5' style={{  borderBlockColor:'silver' }}>
                    <img src="./sign.svg" style={{ maxWidth: 400 }} alt="" />
                </div>
            </div>

        </>
    )
}

export default Sign_img
